        <Options>Internship Description</Options>
    </Wrapper>
  )
}

export default flow

const Wrapper = styled.div`
    border-radius: 1rem;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
`

const Options = styled.div`

